import React from "react";
import { Card } from "antd";
import Avatar from "antd/lib/avatar/avatar";

const UserProfile = () => {
  return (
    <Card
      actions={[
        <div key='twit'>
          gogo <br /> 0
        </div>,
        {
          /* <div key='following'> */
        },
        // <div>
        //   Following <br /> 0
        // </div>,
        // {/* <div key='followers'> */}
        // <div>
        //   Followers <br /> 0
        // </div>,
      ]}>
      <Card.Meta avatar={<Avatar>JK</Avatar>} title='Kevin Kim' />
    </Card>
  );
};

export default UserProfile;
